import './Navigation.css'

const Navigation = () => {
  return (
  <div class='navigation'>
        <p class='title'>josh</p>
        <ul class='navigation-links'>

            <li><a href='#about'>about</a></li>
            <li><a href='#work'>contact</a></li>
        </ul>
  </div>
  );
};

export default Navigation;
